// src/components/SplashPage.js
import React, { useEffect } from "react";

function SplashPage() {
  useEffect(() => {
    const script = document.createElement("script");
    script.type = "module";
    script.src = "https://unpkg.com/@splinetool/viewer@1.10.13/build/spline-viewer.js";
    script.async = true;
    document.body.appendChild(script);

    return () => {
      document.body.removeChild(script); // cleanup when unmounting
    };
  }, []);

  return (
    <div style={{ width: "100%", height: "100vh", overflow: "hidden" }}>
      <spline-viewer
        url="https://prod.spline.design/sz5sXBPD4eWs-eEk/scene.splinecode"
        style={{ width: "100%", height: "100%" }}
      ></spline-viewer>
    </div>
  );
}

export default SplashPage;
